window.bookSummaryJSON = "<p>Londons fall and kingdoms rise while darkness sweeps the Maresh Empire, and the fraught balance of magic blossoms into dangerous territory while heroes struggle. The direct sequel to <i>A Gathering of Shadows</i>, and the final audiobook in the Shades of Magic epic fantasy series, <i>A Conjuring of Light</i> sees the newly minted <i>New York Times</i> best-selling author V. E. Schwab reach a thrilling conclusion concerning the fate of beloved protagonists - and old foes. </p> <p><b>Shades of Magic series</b> <br> 1. <i>A Darker Shade of Magic</i> <br> 2. <i>A Gathering of Shadows</i> <br> 3. <i>A Conjuring of Light</i> </p>"; 
